import React, { Component } from "react";
import "./index.scss";
import { injectIntl, FormattedMessage } from "react-intl";
import terms_logo from "../../../../Image/terms_logo.jpg";

class Footer extends Component {
  render() {
    return (
      <div className="Footer">
        <div className="Footer--Inner">

          <p className="Terms">
            <a 
              href="https://beian.miit.gov.cn"
              className="Link"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img className="Terms--Icon" src={terms_logo}/>
              <FormattedMessage id="ID_FOOTER_TERMS_1" />
            </a>
          </p>


          <p className="Terms">
            <a 
              href="https://beian.miit.gov.cn"
              className="Link"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img className="Terms--Icon" src={terms_logo}/>
              <FormattedMessage id="ID_FOOTER_TERMS_2" />
            </a>
          </p>



          <div className="Info--Copy">
            <FormattedMessage id="ID_HOME_COPY_INFO" />
          </div>
          {/* <img className="Logo" src={logo_gray} alt="logo" /> */}
        </div>
      </div>
    );
  }
}
export default injectIntl(Footer);
